/*
No permite cruces
Tope minimo para la cantidad de cursos
Tope maximo para la cantidad de creditos
*/
bool valid(int pos , int cnt , int cred){
	if(cnt < minCourses) return 0;
	if(cred > maxCred) return 0;
	for( int i = 8 ; i <= 22 ; ++i )
		for( int j = 0 ; j < 6 ; ++j ){
			int len = S[ j ][ i ].size();
			if( len > 1 ) return 0;
		}
	return 1;
}
