void back( int pos , int cnt , int cred ){
	if( pos == (int)P.size() ){
		//print
		if( !valid(pos,cnt,cred) ) return;
		cout << setw( cte ) << "";
		for( int i = 0 ; i < 6 ; ++i )
			cout << setw( cte ) << days[ i ];
		cout <<  " esc " << ++esc << endl;
		vector<string> vec;
		for( int i = 8 ; i <= 22 ; ++i ){
			cout << setw( cte ) << i;
			for( int j = 0 ; j < 6 ; ++j ){
				string cad ;
				int len = S[ j ][ i ].size();
				if( len  == 0 ) cad = "---";
				else if( len == 1 ){
					cad = S[ j ][ i ].back();
					vec.push_back(cad);
				}
				cout << setw( cte ) << cad;
			}
			cout << '\n';
		}
		cout << "creditaje = " << cred << endl;
		cout << "cantidad de cursos = " << cnt << endl;
		sort(vec.begin(),vec.end());
		vec.resize(unique(vec.begin(),vec.end()) - vec.begin());
		cout << setw(6) << "Cur-Sec" << " " << setw(35) << "Nombre del curso" << setw(50) << "Docente(s)" << endl;
		for( auto x : vec ){
			string s = x;
			s.pop_back();
			int id = mapaCourseId[ s ];
			//cout << s << " " << id << endl;
			cout << setw(6) << x << " " << setw(35) << coursesName[ id ];
			for(auto y : teachers[x]) cout << " (" << y << ")";
			cout << endl;
		}
		return;
	}
	back( pos + 1 , cnt , cred );
	auto it1 = P[ pos ];
	for( auto x : T[ it1 ] ){
		string sec = x.first;
		vector< pair< int , int > > V = x.second;
		for( int i = 0 ; i < (int)V.size() ; ++i){
			int a = V[ i ].first;
			int b = V[ i ].second;
			S[ a ][ b ].push_back( courseName[ P[ pos ] ] + sec );
		}
		back( pos + 1 , cnt + 1 , cred + coursesCred[ mapaCourseId[ courseName[ P[ pos ] ] ] ] );
		for( int i = 0 ; i < (int)V.size() ; ++i){
			int a = V[ i ].first;
			int b = V[ i ].second;
			S[ a ][ b ].pop_back();
		}
	}
}
